query:
PREFIX dcterms: <http://purl.org/dc/terms/>
select distinct ?s where {
?o dcterms:subject ?s
} LIMIT 100

PREFIX dcterms: <http://purl.org/dc/terms/>
select distinct ?s where {
?o dcterms:subject ?s.
?s rdfs:labe ?l.
FILTER REGEX(?l, "^mobile", "i")
} LIMIT 100

PREFIX dcterms: <http://purl.org/dc/terms/>
select distinct ?s ?l where {
?o dcterms:subject ?s.
?s rdfs:label ?l.
#FILTER REGEX(?l, "^mobile", "i")
} LIMIT 100

PREFIX dcterms: <http://purl.org/dc/terms/>
select distinct ?s ?l where {
?o dcterms:subject ?s.
?s rdfs:label ?l.
FILTER REGEX(?l, "^mobile", "i")
} LIMIT 100

SELECT ?root ?leaf
 WHERE {
    ?root skos:narrower  ?leaf .
    NOT EXISTS {?leaf skos:narrower ?node }
 }
LIMIT 100

PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX category: <http://dbpedia.org/resource/Category:>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>
SELECT ?root ?leaf
 WHERE {
    ?root skos:narrower  ?leaf .
    NOT EXISTS {?leaf skos:narrower ?node .}
 }
LIMIT 100

PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX category: <http://dbpedia.org/resource/Category:>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>
SELECT ?root ?leaf
 WHERE {
    ?root skos:narrower  ?leaf .
    FILTER NOT EXISTS {?leaf skos:narrower ?node .}
 }
LIMIT 100

PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX category: <http://dbpedia.org/resource/Category:>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>
SELECT ?node2
 WHERE {
    ?node1 skos:narrower ?node2 .
    OPTIONAL {?node2 skos:narrower ?node3 }
    FILTER(!BOUND(?node3))
 }
LIMIT 100

PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX category: <http://dbpedia.org/resource/Category:>
PREFIX skos: <http://www.w3.org/2004/02/skos/core#>
SELECT ?node1 ?node2
 WHERE {
    ?node1 skos:narrower ?node2 .
    OPTIONAL {?node2 skos:narrower ?node3 }
    FILTER(!BOUND(?node3))
 }
LIMIT 100
